import { useEffect, useState } from "react";
import { normalizeInput } from "../../scripts/pieces"; // Import the function you want to benchmark

const SetPage = () => {
  const [benchmarks, setBenchmarks] = useState<any[]>([]);

  // Function to generate a large input string with a specific size
  const generateTestCase = (size: number): string => {
    const pieces = "TIJLOSZ"; // The character set we're working with
    let result = "";
    for (let i = 0; i < size; i++) {
      result += pieces[Math.floor(Math.random() * pieces.length)];
    }
    return result;
  };

  // Function to run the benchmark and store results
  const runBenchmark = () => {
    const testCases = [
      { size: 100, label: "100 chars" },
      { size: 500, label: "500 chars" },
      { size: 1000, label: "1000 chars" },
      { size: 5000, label: "5000 chars" },
      { size: 10000, label: "10000 chars" },
    ];

    const results: any[] = [];

    testCases.forEach(({ size, label }) => {
      const input = generateTestCase(size);

      const start = performance.now(); // Start time measurement
      const normalized = normalizeInput(input); // Run the normalization
      const end = performance.now(); // End time measurement

      results.push({
        label,
        duration: end - start,
        size,
        normalizedOutput: normalized.substring(0, 50), // Just show the first 50 chars of output for brevity
      });
    });

    setBenchmarks(results); // Store benchmark results
  };

  useEffect(() => {
    runBenchmark();
  }, []); // Run benchmark when the component is mounted

  return (
    <div>
      <h1>Benchmark Results for normalizeInput</h1>
      {benchmarks.length > 0 && (
        <table>
          <thead>
            <tr>
              <th>Test Case</th>
              <th>Input Size</th>
              <th>Duration (ms)</th>
              <th>Normalized Output (First 50 chars)</th>
            </tr>
          </thead>
          <tbody>
            {benchmarks.map((benchmark, index) => (
              <tr key={index}>
                <td>{benchmark.label}</td>
                <td>{benchmark.size}</td>
                <td>{benchmark.duration.toFixed(5)}</td>
                <td>{benchmark.normalizedOutput}</td>
              </tr>
            ))}
          </tbody>
        </table>
      )}
    </div>
  );
};

export default SetPage;
